script: |
  super -f text -I q9084.spq | sort > q9084.out

inputs:
  - name: q9084.spq
    data: |
      SELECT + CAST ( + col0 AS INTEGER ) * 11 FROM tab1 (FORMAT parquet) WHERE NOT col2 * col2 * - 35 IN ( + 10 + - - 1 + + col2 ) AND NULL BETWEEN ( - col2 ) AND ( 59 );
  - name: tab1

outputs:
  - name: q9084.out
    data: |
